def board_hash(board):
    ans = 0
    for x in board:
        ans = (ans * HASH_P + x) % HASH_MOD
    return ans


def prepare_groups():
    def encode_coord(x, y):
        assert 0 <= x < NCOLS
        assert 0 <= y < NROWS
        return y * NCOLS + x

    groups = []
    # Horizontal groups
    for y in range(NROWS):
        for x in range(NCOLS - INAROW + 1):
            groups.append([encode_coord(x + i, y) for i in range(INAROW)])
    # Vertical groups
    for x in range(NCOLS):
        for y in range(NROWS - INAROW + 1):
            groups.append([encode_coord(x, y + i) for i in range(INAROW)])
    # Diagonals
    for x in range(NCOLS - INAROW + 1):
        for y in range(NROWS - INAROW + 1):
            groups.append([encode_coord(x + i, y + i) for i in range(INAROW)])
            groups.append([encode_coord(x + i, y + 3 - i) for i in range(INAROW)])
    return np.array(groups)


GROUPS = prepare_groups()


# If returns WIN_COST or -WIN_COST - then it's deterministic win or loss.
@numba.jit("i8(i8[:])", nopython=True)
def heuristic_cost(state):
    # assert len(state) == N
    ctr = np.zeros(101, dtype=np.int64)
    for i in range(len(GROUPS)):
        s = 0
        for j in range(INAROW):
            s += state[GROUPS[i][j]]
        ctr[s] += 1
    # print("Counters:", ctr)
    if ctr[20] > 0:
        return -WIN_COST
    if ctr[3] > 0:
        return +WIN_COST
    c1 = 1000 * ctr[28] + 10 * ctr[2] + 5 * ctr[27] + 3 * ctr[52]
    c2 = 5000 * ctr[15] + 1000 * ctr[40] + 10 * ctr[10] + 5 * ctr[35] + 3 * ctr[60]
    return c1 - c2


@numba.jit(nopython=True)
def negamax_cost(state, a, b, depth):
    h_cost = heuristic_cost(state)
    if h_cost == -WIN_COST or depth == 0:
        return h_cost, None

    best_cost = -WIN_COST - 1
    best_action = None

    next_state = np.copy(state)
    for j in range(N):
        if next_state[j] == 1:
            next_state[j] = 5
        elif next_state[j] == 5:
            next_state[j] = 1

    for i in range(N):
        if next_state[i] != 0:
            continue
        next_state[i] = 5
        if i >= NCOLS:
            next_state[i - NCOLS] = 0

        next_cost = -negamax_cost(next_state, -b, -a, depth=depth - 1)[0]
        assert next_cost >= -WIN_COST
        if next_cost > best_cost:
            best_cost = next_cost
            best_action = i % NCOLS
        a = max(a, next_cost)
        if best_cost >= b:
            break

        next_state[i] = 0
        if i >= NCOLS:
            next_state[i - NCOLS] = 25

    return best_cost, best_action


def observation_to_state(observation):
    b = observation.board
    mark = observation.mark
    assert mark in [1, 2]
    assert len(observation.board) == N
    ans = np.zeros(N, dtype=np.int64)
    for i in range(N):
        if b[i] == 0:
            ans[i] = 0 if (i + NCOLS >= N or b[i + NCOLS] != 0) else 25
        else:
            ans[i] = 1 if b[i] == mark else 5
    return ans


def the_agent(observation, configuration, debug=False):
    # Number of Columns on the Board.
    assert configuration.columns == NCOLS
    assert configuration.rows == NROWS
    assert configuration.inarow == INAROW

    hsh = board_hash(observation.board)
    if hsh in BOOK:
        action = BOOK[hsh]
        if debug:
            print("Action from book: ", action)
        return action

    # If only one column left, no choice.
    columns = [c for c in range(NCOLS) if observation.board[c] == 0]
    assert 1 <= len(columns) <= 7
    if len(columns) == 1:
        return columns[0]

    state = observation_to_state(observation)
    t0 = time.time()
    nm_cost, action = negamax_cost(state, -WIN_COST, +WIN_COST, NEGAMAX_DEPTH)
    if debug:
        print(
            "Negamax cost: %d. Heuristic cost: %d. Decided action: %d. Time: %f."
            % (heuristic_cost(state), nm_cost, action, time.time() - t0)
        )
    assert 0 <= action < NCOLS
    return action
